-- tbscheduletaskregistry 配置 begin
-- 删除fund的 registry
delete from tbscheduletaskregistry where substr(sche_task_code, 1, 4) = 'fund';
/* 主库交易广播配置 */
insert into tbscheduletaskregistry (sche_task_code, app_name, app_group, app_version, 
       app_url, sche_app_isuse)
select a.sche_task_code, 'ta-fund-parameter-batch' app_name, 'group' app_group, '1.0' app_version, 
       '/fund/pub/batch' app_url, '1' sche_app_isuse
  from tbscheduletask a 
 where substr(a.sche_task_code, 1, 4) = 'fund' 
   and substr(a.function_id, 1, 4) = 'PUB9'
   and a.ta_code = '000000';

/* 交易库交易广播配置 多个分库的情况下，修改针对不同的app_name多次执行 */
insert into tbscheduletaskregistry (sche_task_code, app_name, app_group, app_version, 
       app_url, sche_app_isuse)
select a.sche_task_code, concat('ta-fund-trans-batch', b.area_num) app_name, 'group' app_group, '1.0' app_version, 
       '/ta/fund/trans/batch' app_url, '1' sche_app_isuse
  from tbscheduletask a, (
	select 1 as area_num from tbareainfo where busin_type = '5' and 1 <= tot_area_num
	union all
	select 2 as area_num from tbareainfo where busin_type = '5' and 2 <= tot_area_num
	union all
	select 3 as area_num from tbareainfo where busin_type = '5' and 3 <= tot_area_num
	union all
	select 4 as area_num from tbareainfo where busin_type = '5' and 4 <= tot_area_num
	union all
	select 5 as area_num from tbareainfo where busin_type = '5' and 5 <= tot_area_num
	union all
	select 6 as area_num from tbareainfo where busin_type = '5' and 6 <= tot_area_num
	union all
	select 7 as area_num from tbareainfo where busin_type = '5' and 7 <= tot_area_num
	union all
	select 8 as area_num from tbareainfo where busin_type = '5' and 8 <= tot_area_num
	union all
	select 9 as area_num from tbareainfo where busin_type = '5' and 9 <= tot_area_num
	union all
	select 10 as area_num from tbareainfo where busin_type = '5' and 10 <= tot_area_num
 ) b  
 where substr(a.sche_task_code, 1, 4) = 'fund' 
   and substr(a.function_id, 1, 4) = 'FUND'
   and a.ta_code = '000000';

/* 账户库交易广播配置 多个分库的情况下，修改针对不同的app_name多次执行 */
insert into tbscheduletaskregistry (sche_task_code, app_name, app_group, app_version, 
       app_url, sche_app_isuse)
select a.sche_task_code, concat('ta-fund-account-batch', b.area_num) app_name, 'group' app_group, '1.0' app_version, 
       '/ta/acc/fund/batch' app_url, '1' sche_app_isuse
  from tbscheduletask a, (
	select 1 as area_num from tbareainfo where busin_type = '9' and 1 <= tot_area_num
	union all
	select 2 as area_num from tbareainfo where busin_type = '9' and 2 <= tot_area_num
	union all
	select 3 as area_num from tbareainfo where busin_type = '9' and 3 <= tot_area_num
	union all
	select 4 as area_num from tbareainfo where busin_type = '9' and 4 <= tot_area_num
	union all
	select 5 as area_num from tbareainfo where busin_type = '9' and 5 <= tot_area_num
	union all
	select 6 as area_num from tbareainfo where busin_type = '9' and 6 <= tot_area_num
	union all
	select 7 as area_num from tbareainfo where busin_type = '9' and 7 <= tot_area_num
	union all
	select 8 as area_num from tbareainfo where busin_type = '9' and 8 <= tot_area_num
	union all
	select 9 as area_num from tbareainfo where busin_type = '9' and 9 <= tot_area_num
	union all
	select 10 as area_num from tbareainfo where busin_type = '9' and 10 <= tot_area_num
 ) b 
 where substr(a.sche_task_code, 1, 4) = 'fund' 
   and substr(a.function_id, 1, 4) = 'ACC9'
   and a.ta_code = '000000';
-- tbscheduletaskregistry 配置 end
 
commit;
